const start = new Date().getTime();
const result = txs
  .map((txEncoded) => {
    const tx = decodeTxRaw(Buffer.from(txEncoded, 'base64'));
    const { messages } = tx.body;
    const data = messages
      .map((message) => {
        const messageTypeParts = message.typeUrl.split('.');
        const messageType = messageTypeParts[messageTypeParts.length - 1];
        if (!messagesTerra[messageType]) {
          return null;
        }
        const decodedMessage = messagesTerra[messageType].decode(message.value);

        return {
          ...message,
          value: {
            ...decodedMessage,
            executeMsg: JSON.parse(decodedMessage.executeMsg.toString()),
          },
        };
      })
      .filter((val) => !!val);
    if (!data.length) {
      return null;
    }
    const finalBody = { ...tx.body, messages: data };
    return { ...tx, body: finalBody };
  })
  .filter((val) => !!val);
console.log(`Elapsed ${(new Date().getTime() - start) / 1000}`);
console.log(JSON.stringify(result));
